sys_script_include.script:
// @ts-nocheck

/**
 * Repository class for interacting with the task table.
 * Extends the FCRepository class.
 * @class
 * @extends FCRepository
 */
var TaskRepository = Class.create();

TaskRepository.prototype = Object.extendsObject(FCRepository, {

    /**
     * Initializes a new instance of TaskRepository.
     * @param {boolean} overrideACL - Whether to override ACL checks.
     * @throws Will throw an error if initialization fails.
     */
    initialize: function (overrideACL) {
		this.moduleName = 'TaskRepository';
        TaskRepository.prototype.initialize.call(this, 'task', overrideACL);
    },

    /**
     * The type name of the class.
     * @type {string}
     */
    type: 'TaskRepository'
});
